import React, { Component } from 'react';

class Navbar extends Component {
  render() {
    return (
      <div id="navbar">
        <h1>Sarah Alt</h1>
        <div className="navbar_sections">
          <p>Experiences</p>
          <p>Projects</p>
        </div>

      </div>
    );
  }
}

export default Navbar;
